import React, { useState } from "react";
import { FaShoppingCart } from "react-icons/fa";

const books = [
  {
    id: 1,
    title: "Reasoning Mastery",
    author: "R.S. Aggarwal",
    price: "â‚¹450",
    image: "/images/reasoning.jpeg",
    link: "https://amzn.in/d/gRdIi14",
  },
  {
    id: 2,
    title: "Aptitude Skills",
    author: "Arun Sharma",
    price: "â‚¹499",
    image: "/images/aptitude.jpeg",
    link: "https://amzn.in/d/9voi2fZ",
  },
  {
    id: 3,
    title: "Placement Tips",
    author: "Expert Panel",
    price: "â‚¹299",
    image: "/images/placement_tips.jpeg",
    link: "https://amzn.in/d/4QRJJCO",
  },
  {
    id: 4,
    title: "HR Interview Guide",
    author: "Career Guru",
    price: "â‚¹399",
    image: "/images/hr_interview.jpeg",
    link: "https://amzn.in/d/jksshdd",
  },
  {
    id: 5,
    title: "Coding Interview",
    author: "Narasimha Karumanchi",
    price: "â‚¹699",
    image: "/images/coding_interview.jpeg",
    link: "https://amzn.in/d/a4NFh5r",
  },
];

const Books = () => {
  const [search, setSearch] = useState("");

  const filteredBooks = books.filter((book) =>
    book.title.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="books-container" style={{ textAlign: "center", padding: "20px" }}>
      {/* Header Section */}
      <header style={{ marginBottom: "30px" }}>
        <img
          src="/images/ppklogo.png"
          alt="PPK Logo"
          style={{ width: "120px", marginBottom: "10px" }}
        />
        <h1 style={{ color: "gold", textShadow: "0 0 10px gold" }}>
          Placement Preparation Kit
        </h1>
        <p style={{ color: "#fff" }}>ðŸ“š Explore our curated books for placements</p>
      </header>

      {/* Search Bar */}
      <input
        type="text"
        placeholder="ðŸ” Search books..."
        value={search}
        onChange={(e) => setSearch(e.target.value)}
        style={{
          padding: "10px",
          width: "60%",
          marginBottom: "30px",
          borderRadius: "25px",
          border: "none",
          outline: "none",
          fontSize: "16px",
        }}
      />

      {/* Books Grid */}
      <div
        className="books-grid"
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(250px, 1fr))",
          gap: "20px",
        }}
      >
        {filteredBooks.map((book) => (
          <div
            key={book.id}
            className="book-card"
            style={{
              background: "#1e2a38",
              padding: "20px",
              borderRadius: "15px",
              textAlign: "center",
              boxShadow: "0 4px 8px rgba(0,0,0,0.2)",
              transition: "transform 0.3s",
            }}
            onMouseOver={(e) => (e.currentTarget.style.transform = "scale(1.05)")}
            onMouseOut={(e) => (e.currentTarget.style.transform = "scale(1)")}
          >
            <img
              src={book.image}
              alt={book.title}
              style={{
                width: "100%",
                height: "200px",
                objectFit: "cover",
                borderRadius: "10px",
                marginBottom: "15px",
              }}
            />
            <h2 style={{ color: "gold", fontSize: "20px" }}>{book.title}</h2>
            <p style={{ color: "#fff" }}>{book.author}</p>
            <p style={{ color: "lightgreen", fontSize: "18px" }}>{book.price}</p>
            <a href={book.link} target="_blank" rel="noopener noreferrer">
              <button
                style={{
                  backgroundColor: "#00c2ff",
                  color: "#fff",
                  padding: "10px 20px",
                  borderRadius: "25px",
                  border: "none",
                  cursor: "pointer",
                  marginTop: "10px",
                  fontWeight: "bold",
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  gap: "8px",
                }}
              >
                <FaShoppingCart /> Buy Now
              </button>
            </a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Books;
